import './App.css';

import Landingpage from "./Landingpage.js";
import "./Landingpage.css";
import{BrowserRouter, Route, Routes} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>

      <Routes>
        <Route to ="/login" component={<Landingpage/>}/>
      </Routes>

    </BrowserRouter>
  );
}

export default App;
